import React from 'react';
import { View, Text, TouchableOpacity, StyleSheet, Image, Animated, Easing } from 'react-native';
import cut from "./images/cut.png";
import lup2 from "./images/suche.png";



const TopBar = () => {
    return(
        <View style={stylesContainers.container}>
            <View style={stylesContainers.titlev}>
                <Text style={stylesContainers.iksk}>Im Kinsky</Text>
            </View>
            <View style={stylesContainers.ocon}>
                <Text style={stylesContainers.gr}>Angemeldete Person</Text>
            </View>
        </View>
    );

};

const stylesContainers = StyleSheet.create({
    container: {
        flexDirection: "row",
        alignItems: 'center',
        width: 1800,
        height: 76,
        borderBottomWidth: 1,          // Sets the width of the bottom border
        borderBottomColor: 'lightgray' // Sets the color of the bottom border
    },
    titlev: {
        paddingLeft: 30,
    },
    iksk:{
        fontSize: 25,
        color: 'rgba(246,203,108,1)',
        fontWeight: "bold",
    },
    gr:{
        color: "grey",
    },
    ocon:{
        paddingLeft: 200,
    }




});
export default TopBar;
